description:
Steve (Billy Dee) runs a dude ranch in the mountains and, after teaching Suzie (Amber Lynn) the finer points of &quot;horsing around&quot; he challenges this rich little Beverly Hills &quot;brat&quot; and her friends to a game of &quot;Cowboys and Indians&quot;. In the sexy free-for-all we find out if those &quot;ol' six shooters&quot; are really better than a quiver full of arrows. The cowboys are up to the challenge, but the Indians princesses &quot;head 'em off at the pass&quot;. In the woods, this raiding party would have made Custers Last Stand... his last lay.

